import React, { useState, useEffect } from 'react';
import { useLocation, useHistory } from 'react-router-dom';


const Profile = (props) => {
    let location = useLocation();
    const history = useHistory();
    const [copySuccess, setCopySuccess] = useState('');
    const [loadSkeleton, setLoadSkeleton] = useState(false);
    const [userData, setUserData] = useState({
        id: "",
        full_name: "",
        profile_image: "",
        pres_text: "",
        address: "",
        charity: "",
        price: "",
    });
    const [open, setOpen] = useState(false);
    const [profile, setProfile] = useState(null);

    useEffect(() => {
        const {profile} = props.location.state;
        setProfile(profile);
    }, []);


    const renderVideoElement = (videoToPlay) => {
          return (
              <video id="video-presentation" className="video-styling" playsInline disablePictureInPicture preload="auto">
                <source src={videoToPlay} type="video/mp4" />
              </video>
          );
    }

    const copyLink = (e) => {
        navigator.clipboard.writeText(window.location.href);
        setOpen(true);
        e.preventDefault();
    }

    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }
        setOpen(false);
    };


    return (
        <main className="margin-bottom">
          <div className="page-header-alternative" />
          <article>
            <div className="public-profile-body">
              <div className="top-container">
              <div className="public-profile-top">
                <div className="top-inner">
                  <div className="box-left">
                    <div className="img-wrapper">
                      <img className="public-img" src={userData.profile_image ? userData.profile_image : "https://cdn1.iconfinder.com/data/icons/random-115/24/person-512.png"} alt={`Profile pic of ${userData.full_name}`} />
                    </div>
                  </div>
                  <div className="box-right">
                    <div className="line-detail"/>
                    <div className="info-wrapper-right">
                      <div className="row first-row">
                        <h1>{profile.full_name}</h1>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
              <div className="public-profile-column-right">
                <div className={`column-right-top ${userData.followers === 1337 || !userData.intro_video ? "hidden" : ""}`}>
                  <div className="right-inner">
                    {userData.intro_video && renderVideoElement(userData.intro_video)}
                    <div className="video-pause-filter" />
                    <div className="play-wrapper">
                      <button className="video-btn" />
                    </div>
                  </div>
                </div>
                <div className="column-right-bottom">
                  <button className="new-btn order-profile-btn">Prenota da {profile.price} â‚¬</button>
                </div>
                <div className="">
                  <button className="new-btn share-btn" onClick={copyLink}>Condividi</button>
                </div>
              </div>
            </div>
              <div className={`public-container description ${!profile.pres_text ? "hidden" : ""}`}>
                <div className="description-inner">
                  <p>{profile.pres_text}</p>
                </div>
              </div>
              <div className="public-container information">
                <h3>Come funziona</h3>
                <div className="information-inner">
                  <span>
                    <i className="far fa-check-circle fa-3x small-icon" alt="small icon describing putting an order"/>
                    <p>Richiedi un video</p>
                  </span>
                  <span>
                    <i className="far fa-clock fa-3x small-icon" alt="small icon describing a clock"/>
                    <p>Il profilo ha 7 giorni per completare la richiesta</p>
                  </span>
                  <span>
                    <i className="fas fa-sync fa-3x small-icon" alt="small icon describing an exchange"/>
                    <p>Paghi solo quando ricevi il video</p>
                  </span>
                </div>
              </div>
            </div>
          </article>
        </main>
    );
};

export default Profile;
